"""### **Inflación en Colombia 2019 - 2024**"""

import pandas as pd
import matplotlib.pyplot as plt

# Ruta del archivo de Excel
file_path = "/content/drive/MyDrive/GestionTele/1.1.INF_Serie histórica Meta de inflación IQY.xlsx"

# Cargamos los datos de la hoja 'Sheet1' saltando las primeras 7 filas irrelevantes
df = pd.read_excel(file_path, sheet_name='Sheet1', skiprows=7)

# Renombramos las columnas para una referencia más clara
df.columns = ['Fecha', 'Inflacion_Total', 'Limite_Superior', 'Meta_Inflacion', 'Limite_Inferior']

# Eliminamos filas con datos faltantes en las columnas 'Fecha' o 'Inflacion_Total'
df = df.dropna(subset=['Fecha', 'Inflacion_Total'])

# Convertimos la columna 'Fecha' a tipo string para extraer año y mes
df['Fecha'] = df['Fecha'].astype(str)

# Extraemos el año y el mes de la columna 'Fecha'
df['Año'] = df['Fecha'].str[:4].astype(int)  # Primeros 4 dígitos como año
df['Mes'] = df['Fecha'].str[4:].astype(int)   # Últimos 2 dígitos como mes

# Filtramos los datos para incluir solo los años entre 2019 y 2023 y los meses 1 (enero) y 7 (julio)
filtered_df = df[(df['Año'].between(2019, 2023)) & (df['Mes'].isin([1, 7]))]

# Ordenamos los datos por año y mes para que aparezcan correctamente en el gráfico
filtered_df = filtered_df.sort_values(by=['Año', 'Mes'])

# Creamos etiquetas de tiempo en formato 'Año-Mes' para la gráfica
x_labels = filtered_df['Fecha'].apply(lambda x: f"{x[:4]}-{x[4:]}")

# Obtenemos los valores de inflación total para los puntos en el gráfico
y_values = filtered_df['Inflacion_Total']

# Configuramos el tamaño de la figura para el gráfico
plt.figure(figsize=(10, 6))

# Graficamos los valores con líneas y marcadores
plt.plot(x_labels, y_values, marker='o', linestyle='-', linewidth=2, color="#4e3b31")

# Agregamos el título y etiquetas a los ejes
plt.title('Inflación en Colombia (Enero y Julio, 2019-2023)')
plt.xlabel('Fecha')
plt.ylabel('Inflación Total (%)')
plt.grid(True)

# Rotamos las etiquetas del eje x para mejorar la legibilidad
plt.xticks(rotation=45)

# Ajustamos el diseño para evitar solapamiento de elementos
plt.tight_layout()

# Mostramos el gráfico
plt.show()

