file_path_population_updated = "/content/drive/MyDrive/GestionTele/2API_SP.POP.TOTL_DS2_es_excel_v2_31748.xlsx"

# Cargamos la hoja 'Data' y saltamos las primeras tres filas irrelevantes
df_population_clean = pd.read_excel(file_path_population_updated, sheet_name='Data', skiprows=3)

# Filtramos para obtener solo la fila correspondiente a Colombia
colombia_population = df_population_clean[df_population_clean['Country Name'] == 'Colombia']

# Seleccionamos las columnas correspondientes a los años 2019 a 2023
colombia_population = colombia_population[['Country Name', '2019', '2020', '2021', '2022', '2023']]

# Reestructuramos los datos para que cada año y su población aparezcan como filas
colombia_population_melted = colombia_population.melt(
    id_vars=['Country Name'], var_name='Año', value_name='Población'
)

# Convertimos la columna 'Año' a tipo entero para su correcta manipulación
colombia_population_melted['Año'] = colombia_population_melted['Año'].astype(int)

# Extraemos los años y poblaciones para crear los puntos de mitad de año
years = colombia_population_melted['Año'].to_list()
populations = colombia_population_melted['Población'].to_list()

# Calculamos los puntos intermedios (años y poblaciones) para graficar de manera más suave
mid_years = [(years[i] + years[i + 1]) / 2 for i in range(len(years) - 1)]
mid_populations = [(populations[i] + populations[i + 1]) / 2 for i in range(len(populations) - 1)]

# Combinamos los puntos originales con los puntos intermedios
plot_years = [val for pair in zip(years, mid_years) for val in pair] + [years[-1]]
plot_populations = [val for pair in zip(populations, mid_populations) for val in pair] + [populations[-1]]

# Configuramos la figura para la gráfica
plt.figure(figsize=(10, 6))

# Graficamos los puntos con líneas y marcadores
plt.plot(plot_years, plot_populations, marker='o', linestyle='-', linewidth=2, color="#800020")

# Añadimos cuadrícula, título y etiquetas de los ejes
plt.grid(True)
plt.title('Población de Colombia (2019-2023)')
plt.xlabel('Año')
plt.ylabel('Población')

# Ajustamos el diseño para evitar solapamientos
plt.tight_layout()

# Mostramos la gráfica
plt.show()

