"""### **MODELO CAUSAL**

**Población Colombia impactos:**
*   A medida que la población crece, es probable que aumente la demanda de servicios como televisión e internet (fijo y móvil), ya que más personas necesitarán estos servicios.
*   Un mayor número de personas también significa más ingresos potenciales por el aumento en la demanda de conectividad.
*   Si el crecimiento de la población provoca un aumento en la demanda general de bienes y servicios, esto puede presionar los precios al alza y, por lo tanto, influir en la inflación y el IPC.


**Inflación Colombia impactos:**
*   A mayor número de población, mayor número de potenciales clientes para los diferentes servicios de internet movil o hogar, y televisión.
*   Si la inflación sube, podría haber un impacto en el poder adquisitivo de los consumidores, reduciendo los ingresos de estos servicios si las personas reducen el uso de internet o cambian a planes más baratos.
*   La inflación alta podría afectar el número de suscriptores de televisión si los consumidores ven los servicios de entretenimiento como un lujo prescindible en tiempos de dificultades económicas.

**IPC Colombia impactos:**
*   De forma similar, si el IPC sube, los consumidores pueden priorizar otros gastos y limitar los gastos en internet, afectando así los ingresos.
*   El IPC es una medida directa de la inflación. Si el IPC sube, la inflación también lo hará, ya que refleja el aumento general en los precios de bienes y servicios.

**Ingresos por internet movil impactos:**
*   Los ingresos pueden estar relacionados con el precio de los planes. Precios más bajos pueden atraer a más suscriptores, mientras que precios más altos pueden disuadir a algunos

**Numero de suscriptores de internet movil impactos:**
*   Podría haber una relación inversa. En áreas rurales, donde el acceso fijo es limitado, el internet móvil puede ser la opción preferida, impactando así los ingresos del internet fijo
*   Un mayor número de suscriptores lleva directamente a un aumento de los ingresos por el servicio de internet móvil.
*   Si los usuarios de internet movil optan por este servicio en vez de internet fijo, es probable que tampoco quieran acceder al servicio de televisión.

**Ingresos internet fijo impactos:**
*   Si los ingresos crecen, se puede invertir más en expandir la infraestructura y aumentar el número de puntos de acceso.

**Numero de puntos de acceso a internet fijo impactos:**
*   La mayor disponibilidad de acceso a internet fijo puede fomentar el uso de plataformas de streaming, reduciendo la demanda de servicios de televisión tradicionales.

**Ingresos de servicio de televisión impactos:**
*   Precios más bajos (o promociones) pueden atraer más suscriptores, mientras que precios más altos podrían reducir el número.

### **GRAFO DEL MODELO CAUSAL**
"""

causal_graph = nx.DiGraph([
     #Población influye en muchos factores
    ('Población', 'IPC'),
    ('Población', 'Inflación'),

    # Inflación tiene influencia en varios factores
    ('Inflación', 'N de suscriptores de internet movil'),
    ('Inflación', 'N de suscriptores de internet fijo'),
    ('Inflación', 'N de suscriptores de televisión'),


    # IPC afecta la inflación y otros aspectos económicos
    ('IPC', 'Inflación'),
    ('IPC', 'N de suscriptores de internet movil'),
    ('IPC', 'N de suscriptores de internet fijo'),
    ('IPC', 'N de suscriptores de televisión'),

    # Relaciones entre tipos de suscriptores
    ('N de suscriptores de internet movil', 'N de suscriptores de internet fijo'),
    ('N de suscriptores de internet movil', 'N de suscriptores de televisión'),
    ('N de suscriptores de internet fijo', 'N de suscriptores de televisión')
])
# Posiciones de los nodos
pos = nx.spring_layout(causal_graph, seed=42)  # spring_layout posiciona los nodos de manera automática

# Dibujar el grafo
plt.figure(figsize=(15,10))  # Definir tamaño del gráfico
nx.draw(causal_graph, pos, with_labels=True, node_color="lightblue",
        node_size=3000, font_size=10, font_weight="bold", edge_color="gray", arrows=True, arrowsize=20)

# Mostrar el grafo
plt.title("Grafo de modelo causal")
plt.show()

"""### **MODELO CAUSAL**"""

from dowhy import gcm

# Create the structural causal model object
scm = gcm.StructuralCausalModel(causal_graph)

# Automatically assign generative models to each node based on the given data
gcm.auto.assign_causal_mechanisms(scm, datos)

gcm.fit(scm, datos)

import numpy as np


def convert_to_percentage(value_dictionary):
    total_absolute_sum = np.sum([abs(v) for v in value_dictionary.values()])
    return {k: abs(v) / total_absolute_sum * 100 for k, v in value_dictionary.items()}


arrow_strengths = gcm.arrow_strength(scm, target_node='N de suscriptores de televisión')

gcm.util.plot(causal_graph,
              causal_strengths=convert_to_percentage(arrow_strengths),
              figure_size=[15, 10])

"""### **ANÁLISIS DE CAUSALIDAD**"""

import matplotlib.pyplot as plt


def bar_plot(value_dictionary, ylabel, uncertainty_attribs=None, figsize=(10, 8)):
    value_dictionary = {k: value_dictionary[k] for k in sorted(value_dictionary)}
    if uncertainty_attribs is None:
        uncertainty_attribs = {node: [value_dictionary[node], value_dictionary[node]] for node in value_dictionary}

    _, ax = plt.subplots(figsize=figsize)
    ci_plus = [uncertainty_attribs[node][1] - value_dictionary[node] for node in value_dictionary.keys()]
    ci_minus = [value_dictionary[node] - uncertainty_attribs[node][0] for node in value_dictionary.keys()]
    yerr = np.array([ci_minus, ci_plus])
    yerr[abs(yerr) < 10**-7] = 0
    plt.bar(value_dictionary.keys(), value_dictionary.values(), yerr=yerr, ecolor='#1E88E5', color='#ff0d57', width=0.8)
    plt.ylabel(ylabel)
    plt.xticks(rotation=45)
    ax.spines['right'].set_visible(False)
    ax.spines['top'].set_visible(False)



    plt.show()


iccs = gcm.intrinsic_causal_influence(scm, target_node='N de suscriptores de televisión', num_samples_randomization=500)

bar_plot(convert_to_percentage(iccs), ylabel='Variance attribution in %')

